var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲: https://github.com/mdewcm2023/site-41123145 \n 網站: https://mdewcm2023.github.io/site-41123145 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Brython', 'text': '', 'tags': '', 'url': 'Brython.html'}, {'title': 'w1', 'text': '', 'tags': '', 'url': 'w1.html'}, {'title': 'w3', 'text': 'Windows 利用 Ctrl + Shift + Esc 帶出工作管理員中的效能, 可以檢視電腦硬體與網路的運作狀況. \n 檢查電腦 services, 開始 -> 滑鼠右鍵帶出電腦管理 -> 服務與應用程式 可以查看電腦目前所設定或啟動的 services \n 從上述第二版可攜 Python 轉進第三版: \n 進行下列修改: \n \n 建立 home_ipv6 目錄下的 DeskTop 目錄 (與 AppData 接受程式執行時的暫存檔案) \n 編輯 python.properties 將 line 153 改為: python.command=pythonw \n 編輯 SciTEGlobal.properties 將 line 162 改為: load.on.activate=1 (若編輯中的檔案在其他應用程式修 改後, 可直接在 SciTE 中自動 load. \n 編輯 SciTEGlobal.properties 將 line 204 改為: tabsize=4 \n 編輯 SciTEGlobal.properties 將 line 205 改為: indent.size=4 \n 編輯 SciTEGlobal.properties 將 line 335 # 拿掉 (code.page=65001, 表示編輯區使用 UTF-8 編碼) \n 編輯 SciTEGlobal.properties 將 line 336 以 # 蓋掉 (code.page=0, 表示要用系統的中文編碼, 也就是 big-5) \n \n 修改之後的可攜 Python:  wcm_portable_w2-3.7z \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w9', 'text': '', 'tags': '', 'url': 'w9.html'}, {'title': '權限', 'text': '近端倉儲的設定檔: 倉儲的目錄下 .git 中的config，代表倉儲的 comflguration file (設定檔案) \n', 'tags': '', 'url': '權限.html'}, {'title': '提交', 'text': 'commit \n git commit -m \n message \n 指令執行時，隨後要接上提交字串，說明本次提交的改版說明 \n', 'tags': '', 'url': '提交.html'}, {'title': 'w10', 'text': '', 'tags': '', 'url': 'w10.html'}, {'title': 'w13', 'text': '在 stud2 主機上以 wsgi 執行動態網站, 以 nginx serve 靜態網站: \n stud2 主機上的動態與靜態網站 serving.mp4  (在無 IPv6 網路協定支援情況下, 利用 Putty 設定代理) \n 以 demo2 為示範帳號, 將 resume-scrum-1 倉儲內容送到 stud2 建立靜態網站.mp4 \n 使用 vi 編輯 server.py 放入各自的 9 字頭埠號後, 就可以用 hupper3 -m server.py 測試.mp4 \n 下載  putty 0.78.7z \n 在 stud2 主機建立倉儲的動態系統: \n ssh  demo2@stud2.cycu.org \xa0登入後, 以 ssh-keygen 在 .ssh 目錄下建立 id_rsa,  id_rsa.pub \n .ssh/config: \n \n \n \n \n \n \n 1 \n 2 \n 3 \n 4 \n \n \n \n Host github.com \n User git \n Hostname github.com \n ProxyCommand /usr/bin/ncat --proxy p4.cycu.org:3128 --proxy-type http %h %p \n \n \n \n \n \n \n \n sftp  demo2@stud2.cycu.org \xa0登入後, cd .ssh 然後以 put  config  將代理主機的設定檔案送到 stud2 帳號下的 .ssh 目錄, 使用 get id_rsa.pub 將公鑰取下, 然後以 SciTE 編輯器打開後, 將公鑰內容送到 Github 帳號下的 settings 中的 SSH and GPG 設定區. \n 完成上述設定後, 以 SSH 協定取下倉儲: \n ssh 登入帳號後, 在所在目錄 /home/帳號/, 以 git clone  git@github.com:wcm2023 /倉儲名稱.git repo \n cd repo \n 利用以下指令, 將 acp 設為 user 可以執行 (Execute): \n chmod u+x acp \n 以 sftp get 取下 repo 目錄下的 waitress_server.py \n 在 Windows 編輯 waitress_server.py, 之後存為 server.py, 再送回 repo 目錄下. \n 編輯過程在填入個人帳號所配發的 9 字頭的埠號. \n ssh 遠端登入到 repo 目錄下, 執行 hupper3 -m server.py 測試是否已經以  https://stud2.cycu.org: 8字頭的埠號. 若可以連結, 必須馬上更改登入密碼. \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w15', 'text': '', 'tags': '', 'url': 'w15.html'}, {'title': 'w16', 'text': '', 'tags': '', 'url': 'w16.html'}]};